function formatTexts(data,width,height,padding,fontSize){
	var normalColor = 'fill:rgb(137,137,137)';
	var hightlightColor = 'fill:rgb(0,0,0); font-weight:bold';
	//var unit =  3.779528;
	var maxX = Math.floor(width-padding*2);
	var maxY = Math.floor(height-padding*2);
	//console.log(maxX,maxY);
	var contents = [];
	var content ='';
	var testLine = '';
	var y = 0;
	for (var i=0; len=data.length,i<len;i++){
		var obj = data[i];
		testLine += obj.to+'@@';
		//var metrics = context.measureText(testLine);
		//var testWidth = metrics.width;
		testWidth = testLine.length*fontSize*0.2117;
		//console.log(testWidth);
		if (testWidth<maxX) {
			if (obj.status == 'sent') {
				contents.push('<tspan text-anchor="start" alignment-baseline="before-edge" style="'+hightlightColor+'">'+obj.to+'&#160;&#160;</tspan>');
			} else {
				contents.push('<tspan text-anchor="start" alignment-baseline="before-edge" style="'+normalColor+'">'+obj.to+'&#160;&#160;</tspan>');
			}
			//console.log(obj.to);
		} else {
			//console.log("换行");
			testLine = obj.to+'  ';
			y+= fontSize*1.5*0.352778;
			if (y>maxY) break;
			if (obj.status == 'sent') {
				contents.push('<tspan x="'+padding+'mm" dy="1.5em" text-anchor="start" alignment-baseline="before-edge" style="'+hightlightColor+'">'+obj.to+'&#160;&#160;</tspan>');
			} else {
				contents.push('<tspan x="'+padding+'mm" dy="1.5em" text-anchor="start" alignment-baseline="before-edge" style="'+normalColor+'">'+obj.to+'&#160;&#160;</tspan>');
			}
		}
	}

	for (var i=0; len=contents.length,i<len; i++) {
		content += contents[i];
	}
	return content;
}

